        REPEAT_TIME INTEGER,
        REPEAT_CNT INTEGER,
        START_TIME CHARACTER(6),
        END_TIME CHARACTER(6),
        LAST_RUN_TIME CHARACTER(14),
        DUE_TIME CHARACTER(14),
        SUC_FLAG CHARACTER(1),
        FAIL_FLAG CHARACTER(1),
        AUTO CHARACTER(1),
