        DESC2 VARCHAR(1024),
        TIMESTAMPS CHARACTER(14),
        DUALCONTROL_LOCKSTATUS VARCHAR(1),
        CONSTRAINT PK_IFS_CRON_JOB PRIMARY KEY (ID)
    );
